getPSControlLogics.scriptCode:
var ENABLEMULTILOGIN = ibiz.env.customParams.ENABLEMULTILOGIN;
if (ENABLEMULTILOGIN && ENABLEMULTILOGIN === true) {
    // 启用多登录模式,默认显示微信登录
    view.layoutPanel.panelItems.container_login_qr.state.keepAlive = true;
    view.layoutPanel.panelItems.container_login_qr.state.visible = true;
    view.layoutPanel.panelItems.container_qrimg.state.visible = false;
    view.layoutPanel.panelItems.container_pcimg.state.visible = true;
    view.layoutPanel.panelItems.container5.state.visible = false;
} else {
    // 不启用多登录模式，隐藏切换的两个图标及微信登录
    view.layoutPanel.panelItems.container_login_qr.state.visible = false;
    view.layoutPanel.panelItems.container_qrimg.state.visible = false;
    view.layoutPanel.panelItems.container_pcimg.state.visible = false;
    view.layoutPanel.panelItems.container5.state.visible = true;
}

console.log("登录，隐藏QR")
view.layoutPanel.panelItems.container5.state.visible = true;
view.layoutPanel.panelItems.container_qrimg.state.visible = true;
view.layoutPanel.panelItems.container_login_qr.state.visible = false;
view.layoutPanel.panelItems.container_pcimg.state.visible = false;

console.log("登录，隐藏PC")
view.layoutPanel.panelItems.container5.state.visible = false;
view.layoutPanel.panelItems.container_qrimg.state.visible = false;
view.layoutPanel.panelItems.container_login_qr.state.visible = true;
view.layoutPanel.panelItems.container_pcimg.state.visible = true;
